var reverseList = function(head) {
 if(!head || !head.next){
     return head
 }
 let temp; 
 let pre = null;
 let cur = head;
 while(cur){
     temp = cur.next; //\u8BB0\u5F55\u4E0B\u4E00\u4E2A\u8282\u70B9
     cur.next = pre //\u4E0B\u4E00\u8282\u70B9\u7684\u6307\u5411\u5F80\u524D

     pre = cur     
     cur = temp
 }
 return pre
};
`,paraId:1,tocIndex:3},{value:`/**
 * Definition for singly-linked list.
 * function ListNode(val, next) {
 *     this.val = (val===undefined ? 0 : val)
 *     this.next = (next===undefined ? null : next)
 * }
 */
/**
 * @param {ListNode} head
 * @return {ListNode}
 */
var reverseList = function(head) {
    if(!head || !head.next){
        return head
    }
    let node = reverseList(head.next)
    head.next.next = head
    head.next = null
    
    return node
};
